import VueRouter from "vue-router";
import Home from "@/pages/Content.vue"
import HomeOne from "@/pages/Content"

const router = new VueRouter({
    routes : [
        {   path: '/home',
            component: HomeOne
        },
    ],

    mode:'history'
})

export default router
